ANITA DE MONTE LAUGHS LAST – a BookSparks Winter Reading Challenge pick, @ReesesBookClub pick, and one of this year’s most anticipated releases from bestselling author Xochitl Gonzalez – is officially available in a bookshop near you 🎉 Perfect for readers who love the mystique of the art scene, introspective narratives, and witty characters!

@XochitlTheG’s mesmerizing sophomore novel is about a first-generation Ivy League student, Raquel, who uncovers the genius work of female artist, Anita de Monte, decades after her suspicious death. Moving back and forth through time and told from the perspective of both women, it is a propulsive, witty examination of power, love, and art, daring to ask who gets to be remembered and who is left behind in the rarefied world of the elite.

Have you grabbed your copy to read along with BookSparks for #WRC2024?

