Con el inicio de las #campañaspresidenciales, las primeras iniciativas dadas a conocer han sido en materia de seguridad, uno de los temas más importantes para #México ante la escalada de #violencia de los últimos años, así como la disputa entre diferentes grupos criminales.

El tema de la seguridad no solo se ha utilizado desde las propuestas, pues @claudia_shein ha criticado a los antiguos gobiernos panistas y priistas, diciendo que ellos quieren una #guerra contra el #narcotráfico, mientras que @xochitlgalvez asegura que se debe dejar de “dar abrazos” a los delincuentes, en referencia a la famosa frase “abrazos, no balazos”, del presidente @lopezobrador.

@alvarezmaynez, de @movciudadanom, también asomó algunas iniciativas en su más reciente visita el Instituto Tecnológico y de Estudios Superiores de Occidente (#ITESO), donde dijo que lo ideal era reforzar a la #policía.

