Esto dicen AMLO y los candidatos presidenciales sobre cerrar la refinería de Cadereyta

@xochitlgalvez dijo que de llegar a la Presidencia en los primeros seis meses de su administración cerraría la refinería porque es la principal fuente de contaminación y enfermedades respiratorias; Jorge @alvarezmaynez recordó a Lázaro Cárdenas y afirmó que si viviera "no estaría pensando en ideas de hace un siglo sino en el futuro de México"; mientras que el presidente Andrés Manuel @lopezobrador se burló de Xóchitl por decir que iba a cerrar la refinería de Tampico y le mandó un mensaje, "el presidente municipal de Cadereyta dijo que no permitiría que se cerrara la refinería".

