#PMX2024 I ¿Cuál fue la primera ‘chamba’ de Sheinbaum, Xóchitl y Máynez?

@xochitlgalvez comenzó a trabajar en su natal Tepatepec como escribiente del Registro Civil, también ha dicho que de niña ayudaba a su familia a vender gelatinas; al finalizar su carrera, @claudia_shein trabajó dando clases de termodinámica en la Facultad de Ciencias, donde además ayudaba a los profesores a preparar sus clases; @alvarezmaynez ha contado que cuando era pequeño trabajó en la tienda de pinturas de su papá y su primer puesto público fue el de regidor en Zacatecas.

